_start:
	movl $0, %esi # %esi/2 = matrix #1 row index(address)
	movl $0, %edi # %edi/2 = matrix #2 col index(address)
L2:
	movl $0, %ecx # compute m3[%esi/2, %edi/2]
	movl $0, %eax
