	movl m2(%edx, %edi, 1), %edx # %edx = m2[%ecx/2, %edi/2]
	imul %edx, %ebx # ebx = m2[%ecx/2, %edi/2] * m1[%esi/2, %ecx/2]
	addl %ebx, %eax
	addl $2, %ecx
	cmpl $400, %ecx
	jnz L1
	
	imul $200, %esi, %edx
	movl %eax, res(%edx, %edi, 1)
	addl $2, %edi # increase col index
	cmpl $400, %edi
	jnz L2 
	
	movl $0, %edi # set col index to 0
	addl $2, %esi # increase row index
	cmpl $400, %esi 
	jnz L2
	
	movl $0, %ebx
	movl $1, %eax
	int $0x80
	
	
